DROP TABLE IF EXISTS gdm_case_caseinfo CASCADE;

CREATE TABLE gdm_case_caseinfo (
    id numeric(16,0) DEFAULT nextval('seq_caseid'::regclass),
    case_code character varying(50) NOT NULL,
    case_time timestamp(6) without time zone NOT NULL,
    case_type numeric(16,0) NOT NULL,
    case_address character varying(255) NOT NULL,
    case_detailedinfo character varying(2000) NOT NULL,
    duty_orgid character varying(50) NOT NULL,
    locate_type numeric(3,0) NOT NULL,
    lon numeric(15,6) NOT NULL,
    lat numeric(15,6) NOT NULL,
    memo character varying(255) NOT NULL,
    create_time timestamp(6) without time zone NOT NULL,
    update_time timestamp(6) without time zone NOT NULL,
    case_level numeric(16,0) NOT NULL,
    case_type_l1 numeric(16,0) NOT NULL,
    case_type_l2 numeric(16,0) NOT NULL,
    duty_orgid_l1 numeric(16,0) NOT NULL,
    duty_orgid_l2 numeric(16,0) NOT NULL,
    geom geometry NOT NULL
);


CREATE INDEX idx_ds_gis_caseinfo_case_code ON gdm.gdm_case_caseinfo USING btree (case_code);
CREATE INDEX idx_ds_gis_caseinfo_case_time ON gdm.gdm_case_caseinfo USING btree (case_time);
CREATE UNIQUE INDEX ds_case_caseinfo_pkey ON gdm.gdm_case_caseinfo USING btree (id);

COMMENT ON COLUMN gdm_case_caseinfo.id IS 'id';
COMMENT ON COLUMN gdm_case_caseinfo.case_code IS '警情编号。警情编号在三台合一中产生，同步过来。通常格式：日期(精确到毫秒)＋台号（3位，前面补零）';
COMMENT ON COLUMN gdm_case_caseinfo.case_time IS '首次报警时间';
COMMENT ON COLUMN gdm_case_caseinfo.case_type IS '案由';
COMMENT ON COLUMN gdm_case_caseinfo.case_address IS '事发地址';
COMMENT ON COLUMN gdm_case_caseinfo.case_detailedinfo IS '事件详情';
COMMENT ON COLUMN gdm_case_caseinfo.duty_orgid IS '管辖单位代码';
COMMENT ON COLUMN gdm_case_caseinfo.locate_type IS '警情定位类型，0－未定位，1-报警定位，2-现场定位，3-手动定位。应该从三台合一同步过来，但是目前三台合一没有这个字段！';
COMMENT ON COLUMN gdm_case_caseinfo.lon IS '经度';
COMMENT ON COLUMN gdm_case_caseinfo.lat IS '纬度';
COMMENT ON COLUMN gdm_case_caseinfo.memo IS '备注';
COMMENT ON COLUMN gdm_case_caseinfo.create_time IS '创建时间';
COMMENT ON COLUMN gdm_case_caseinfo.update_time IS '更新时间';
COMMENT ON COLUMN gdm_case_caseinfo.case_level IS '级别';
COMMENT ON COLUMN gdm_case_caseinfo.case_type_l1 IS 'case_type_l1';
COMMENT ON COLUMN gdm_case_caseinfo.case_type_l2 IS 'case_type_l2';
COMMENT ON COLUMN gdm_case_caseinfo.duty_orgid_l1 IS 'duty_orgid_l1';
COMMENT ON COLUMN gdm_case_caseinfo.duty_orgid_l2 IS 'duty_orgid_l2';
COMMENT ON COLUMN gdm_case_caseinfo.geom IS 'geom';

